-- ----------------------------
-- Table structure for deposit
-- ----------------------------
DROP TABLE IF EXISTS `deposit`;
CREATE TABLE `deposit` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `deposit_code` varchar(255) DEFAULT NULL,
  `trading_id` int(11) DEFAULT NULL COMMENT '外部订单ID',
  `trading_code` varchar(255) DEFAULT NULL COMMENT '外部订单CODE',
  `weight` decimal(12,4) DEFAULT NULL COMMENT '权重',
  `supplier_id` int(11) DEFAULT NULL COMMENT '接口供应商ID',
  `supplier_code` varchar(100) DEFAULT NULL COMMENT '供应商编码',
  `supplier_name` varchar(255) DEFAULT NULL COMMENT '供应商名称',
  `mobile` varchar(50) DEFAULT NULL COMMENT '手机号码',
  `number_type` int(255) DEFAULT NULL COMMENT '手机号码所属供应商（1-移动 2-联通 3-电信）',
  `post_amount` decimal(12,4) DEFAULT NULL COMMENT '提交金额',
  `pay_amount` decimal(12,4) DEFAULT NULL COMMENT '调用接口后返回的实付金额',
  `post_time` datetime DEFAULT NULL COMMENT '提交时间',
  `state` int(255) DEFAULT NULL COMMENT '充值状态(-1-初始状态，0-充值中 ，1-充值成功， 2-部分成功，3-充值失败)',
  `source` int(255) DEFAULT NULL COMMENT '交易来源',
  `source_code` varchar(255) DEFAULT NULL COMMENT '来源编码',
  `type` int(255) DEFAULT NULL COMMENT '交易类型',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=75 DEFAULT CHARSET=utf8 COMMENT='充值接口对象表';

