-- ----------------------------
DROP TABLE IF EXISTS `phone_recharge_product`;
CREATE TABLE `phone_recharge_product` (
  `prod_id` varchar(10) NOT NULL COMMENT '话费充值产品',
  `prod_content` int(11) NOT NULL DEFAULT '0' COMMENT '面额',
  `prod_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '支付价格销售价格',
  `prod_isptype` varchar(50) NOT NULL COMMENT '运营商类别（移动/联通/电信）',
  `prod_delaytimes` varchar(20) NOT NULL COMMENT '充值处理时间（5、24、48）',
  `prod_provinceid` varchar(255) NOT NULL COMMENT '省份名称',
  `prod_type` varchar(50) DEFAULT NULL COMMENT '产品类型(移动电话/固定电话/小灵通）',
  `status` varchar(5) NOT NULL DEFAULT 'ON' COMMENT '状态.ON:启用，OFF:没用',
  PRIMARY KEY (`prod_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='高阳 话费充值产品表';

