DROP TABLE IF EXISTS `trading`;
CREATE TABLE `trading` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `trading_code` varchar(255) DEFAULT NULL COMMENT '交易编码',
  `shop_id` int(11) DEFAULT NULL COMMENT '网点ID',
  `shop_name` varchar(255) DEFAULT NULL COMMENT '网点名称',
  `area_id` int(11) DEFAULT NULL COMMENT '县域ID',
  `area_name` varchar(255) DEFAULT NULL COMMENT '县域名称',
  `order_id` int(11) DEFAULT NULL COMMENT '订单ID',
  `order_code` varchar(100) DEFAULT NULL COMMENT '订单编码',
  `supplier_id` int(11) DEFAULT NULL COMMENT '接口供应商ID',
  `supplier_code` varchar(100) DEFAULT NULL COMMENT '供应商编码',
  `supplier_name` varchar(255) DEFAULT NULL COMMENT '供应商名称',
  `mobile` varchar(50) DEFAULT NULL COMMENT '手机号码',
  `number_type` int(255) DEFAULT NULL COMMENT '手机号码所属供应商（1-移动 2-联通 3-电信）',
  `post_amount` decimal(12,4) DEFAULT NULL COMMENT '提交金额',
  `pay_amount` decimal(12,4) DEFAULT NULL COMMENT '调用接口后返回的实付金额',
  `post_time` datetime DEFAULT NULL COMMENT '提交时间',
  `state` int(255) DEFAULT NULL COMMENT '充值状态(-1-初始状态，0-充值中 ，1-充值成功， 2-部分成功，3-充值失败) ',
  `push_status` int(255) DEFAULT NULL COMMENT '推送状态。0:推送失败，1：推送成功，2：未推送',
  `source` int(255) DEFAULT NULL COMMENT '交易来源',
  `source_code` varchar(255) DEFAULT NULL COMMENT '来源编码',
  `type` int(255) DEFAULT NULL COMMENT '交易类型',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `goods_id` int(11) DEFAULT NULL COMMENT '商品id',
  `depositNo` varchar(20) DEFAULT NULL COMMENT '第三方订单号',
  `sku_id` int(11) DEFAULT NULL COMMENT 'skuId',
  PRIMARY KEY (`id`),
  KEY `trading_code` (`trading_code`)
) ENGINE=InnoDB AUTO_INCREMENT=48 DEFAULT CHARSET=utf8 COMMENT='外部订单表';

